(2, 'Maria Santos', 'MariaSantos@gmail.com', '2024-12-02', 'App', 'The app is good, but it would be great if we could add more documents for request.', '2024-12-10 08:57:08', 1),
(3, 'Pedro Martinez', 'PedroMartinez@gmail.com', '2024-12-03', 'Barangay', 'I think the street lighting can be improved. Some streets are too dark at night.', '2024-12-10 08:57:08', 1),
(4, 'Ana Reyes', 'AnaReyes@gmail.com', '2024-12-04', 'App', 'The app needs a better design. The interface is a bit confusing at times.', '2024-12-10 08:57:08', 1),
(5, 'Carlos Gomez', 'CarlosGomez@gmail.com', '2024-12-05', 'Barangay', 'There should be more community events organized, especially for the youth.', '2024-12-10 08:57:08', 1),
(6, 'Luisa Villanueva', 'LuisaVillanueva@gmail.com', '2024-12-06', 'App', 'The app is useful, but I wish there were more language options for non-Filipino users.', '2024-12-10 08:57:08', 1),
(7, 'Ricardo Lopez', 'RicardoLopez@gmail.com', '2024-12-07', 'Barangay', 'I suggest adding more benches in the public parks for elderly residents to rest.', '2024-12-10 08:57:08', 1),
(8, 'Clara Alvarado', 'ClaraAlvarado@gmail.com', '2024-12-08', 'App', 'The document request feature is very helpful. However, it would be nice to receive email confirmations for all requests.', '2024-12-10 08:57:08', 1),
(9, 'Luis Fernandez', 'LuisFernandez@gmail.com', '2024-12-09', 'Barangay', 'I feel the security patrols should be more visible in the evenings.', '2024-12-10 08:57:08', 1),
(10, 'Isabel Mendoza', 'IsabelMendoza@gmail.com', '2024-12-10', 'App', 'The app works well but sometimes takes time to load. It could be faster.', '2024-12-10 08:57:08', 1),
(11, 'Javier Castillo', 'JavierCastillo@gmail.com', '2024-12-11', 'Barangay', 'There is a need for more public health clinics in our area. Many people have difficulty accessing health services.', '2024-12-10 08:57:08', 1),
(12, 'Beatriz Garcia', 'BeatrizGarcia@gmail.com', '2024-12-12', 'App', 'It would be better if the app had a search bar for quicker navigation.', '2024-12-10 08:57:08', 1),
(13, 'Eduardo Morales', 'EduardoMorales@gmail.com', '2024-12-13', 'Barangay', 'I would appreciate it if the barangay could improve the roads in the area, as there are a lot of potholes.', '2024-12-10 08:57:08', 1),
(14, 'Patricia Lopez', 'PatriciaLopez@gmail.com', '2024-12-14', 'App', 'The app is easy to use, but the font size could be bigger for better readability.', '2024-12-10 08:57:08', 1),
(15, 'Victor Cruz', 'VictorCruz@gmail.com', '2024-12-15', 'Barangay', 'I recommend organizing educational workshops on recycling and environmental care for the community.', '2024-12-10 08:57:08', 1),
(16, 'Gloria Sanchez', 'GloriaSanchez@gmail.com', '2024-12-16', 'App', 'It would be helpful if the app allowed users to track the status of their document requests in real-time.', '2024-12-10 08:57:08', 1),
(17, 'Felipe Diaz', 'FelipeDiaz@gmail.com', '2024-12-17', 'Barangay', 'There should be more efforts in improving the drainage systems. The streets flood during the rainy season.', '2024-12-10 08:57:08', 1),
(18, 'Lucia Reyes', 'LuciaReyes@gmail.com', '2024-12-18', 'App', 'The app is quite good, but I would love to see a feature for scheduling appointments with barangay officials.', '2024-12-10 08:57:08', 1),
(19, 'Antonio Ramirez', 'AntonioRamirez@gmail.com', '2024-12-19', 'Barangay', 'I think the barangay should focus on better healthcare programs for the elderly.', '2024-12-10 08:57:08', 1),
(20, 'Sofia Rivera', 'SofiaRivera@gmail.com', '2024-12-20', 'App', 'Overall, the app is great! However, it needs a better notification system to alert users about updates or new features.', '2024-12-10 08:57:08', 1),
